schemas.content:
scalar JSON

type PageInfo {
  endCursor: ID
  hasNextPage: Boolean
  startCursor: ID
  hasPreviousPage: Boolean
}

type MutationResponse {
  id: ID
  input: JSON
  message: String!
  code: Int!
}

type Mutation {
  createSome(input: SomeInput): MutationResponse
  updateSome(input: SomeInput): MutationResponse
  deleteSome(input: SomeInput): MutationResponse
}

type Query {
  some: SomeNode
}

#######################

type SomeConnection {
  totalCount: Int
  pageInfo: PageInfo
  edges: [SomeEdge]
}

type SomeEdge {
  cursor: ID
  node: SomeNode
}

type SomeNode {
  uuid: ID
  createdAt: Float
  updatedAt: Float
  isDeleted: Boolean

  name: String
}

input SomeInput {
  uuid: ID
  createdAt: Float
  updatedAt: Float
  isDeleted: Boolean

  name: String
}

#######################
